import React from 'react'
import Card from '../Ui/Card';
import classes from './UserList.module.css';

const UserList = () => {
    return (
        <Card className={classses.users}>
            <ul>
                {props.users.Map(user => (<li>{user.name} ({user.age} years old.)</li>))}
            </ul>
        </Card>
    )
}

export default UserList
